description:
Run-D.M.C. - King Of Rock [promo].VOB



HQ rare promo video that featured Calvert DeForest as a security guard. 
The song featured a lyric, &quot;There's three of us but we're not The Beatles&quot; 
in reference to John Lennon's death a few years prior to the song's release.


